import React from 'react';
import { View,Text, TextInput, Button, StyleSheet, Image,Dimensions, TouchableOpacity  } from 'react-native';
const screenWidth = Dimensions.get('window').width;

const styles = StyleSheet.create({
    container: {
      flex:'1',
      alignItems: 'center',
      width:screenWidth,
    },
    input: {
      width: '80%',
      marginVertical: 5,
      padding: 10,
      borderBottomWidth: 1,
      borderColor: 'black',
    //   opacity: '0.5',
    //   borderRadius: 5,
    },
    image:{
        width: screenWidth ,
        height: '35%' ,
        resizeMode: 'cover',
        
        
    },
    login:{
        fontSize: '50px',
        margin: '0px',
    },


    customButton: {
        width: '35%',
        height: 50,
        backgroundColor: '#3498db',
        borderRadius: 15,
        justifyContent: 'center',
        alignItems: 'center',
      },
    buttonText: {
        color: 'white',
        fontSize: 18,
      },
  });
const Test = () => {

    return (
        <View style={{display:'flex',alignItems:'center',justifyContent:'center'}} >
          <Text style={{marginTop:50}}>Hello, World!</Text>
          <Image
                source={require('../images/logo.jpg')} // Đường dẫn đến ảnh trong thư mục assets
                style={styles.image}
            />
        </View>
      );
    };
    


export default Test;
